import React from 'react'
import { Col, Row } from 'react-bootstrap'

const DateList = ({person}) => {
  return (
    <Row className="justify-content-center">
          <Col sm="8">
            <div className="rectangle p-2">
              {person.length ? (person).map((e)=>{
                return (
                  <div className="d-flex  border-bottom my-3">
                  <img className="img-avatar" alt="" src={e.img} />
                  <div className="px-3 ">
                    <p className="fs-5 d-inline">{e.name}</p>
                    <p className="fs-6">{e.time}</p>
                  </div>
                </div>
                )
              }) :<h2 className="text-center">لا يوجد مواعيد اليوم</h2>}
            </div>
          </Col>
        </Row>
  )
}

export default DateList
